textOriginal:
Não vê absolutamente NADA que os diferencia? Então analise da seguinte forma: 

1) Se fossem realmente iguais, ou, mais ainda, se fosse tão cômodo ao PT aprovar suas pautas sem oposição no congresso e sem revolta nas ruas, então,  por que tanto desespero por parte deles em tirar o Bolsonaro? Estariam trocando uma situação em tese confortável por uma bem mais complicada, caso o Lula voltasse;

2) Se os dois fossem iguais, por que tanto esforço dos globalistas, usando todo aparelhamento que possuem, para tentar retira-lo do poder?
